import mongoose from 'mongoose';

const userSchema = new mongoose.Schema({
    name: {
        type: String,
        required: true
    },
    email: {
        type: String,
        required: true,
        unique: true
    },
    password: {
        type: String,
        required: true
    },
    image: {
        type: String,
        default: 'data:image/jpeg;base64,'
    },
    address: {
        type: String,
        default:'not selected'
    },
    phone: {
        type: String,
        default:'000 00 000000'
    },
    gender: {
        type: String,
        default:'not selected'
    },
    dob: {
        type: String,
        default:'not selected'
    }, 
    
});

const User = mongoose.model('User', userSchema);

export default User;
